import React from 'react';
import Tribe from './assets/Tribe.png'
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';
// import Assignment1 from './Assignment1';
import Typography from '@mui/material/Typography';
import {ReactComponent as Hello} from './assets/Hello.svg'


const Index = () => {
  return( 
    <>   
        <Grid container sm={12} padding={5} spacing={2}>
            <Grid item sm={4}  container justifyContent='center'>
                <img src={Tribe} alt='tribe' />
            </Grid>
            <Grid item sm={4} container justifyContent='center'>
                <Button variant='outlined' size='medium' sx={{color: 'white', background: '#407BFF'}}>Assignment 1</Button>
            </Grid>
            <Grid item sm={4} container justifyContent='center'>
                <Button variant='outlined' size='medium' sx={{color: 'white', background: '#407BFF'}}>Assignment 2</Button>
            </Grid>
            <Grid container sm={6}> 
                <Hello style={{width: '100%'}} />
            </Grid>
            <Grid container sm={6}> 
                <Typography variant='h1' style={{color: 'whitesmoke', width: '100%', marginTop: 30}}>Hello!</Typography>
                <Typography variant='h3' style={{color: 'whitesmoke'}}>Shivam here... Full Stack Developer</Typography>
            </Grid>
        </Grid>
    </>
    )
};

export default Index;
